goog.provide("goog.labs.storage.BoundedCollectableStorageTest");goog.setTestOnly("goog.labs.storage.BoundedCollectableStorageTest");goog.require("goog.labs.storage.BoundedCollectableStorage");goog.require("goog.storage.collectableStorageTester");goog.require("goog.storage.storage_test");goog.require("goog.testing.MockClock");goog.require("goog.testing.jsunit");goog.require("goog.testing.storage.FakeMechanism");function testBasicOperations(){var mechanism=new goog.testing.storage.FakeMechanism,storage=new goog.labs.storage.BoundedCollectableStorage(mechanism,5);goog.storage.storage_test.runBasicTests(storage)}function testExpiredKeyCollection(){var mechanism=new goog.testing.storage.FakeMechanism,clock=new goog.testing.MockClock(!0),storage=new goog.labs.storage.BoundedCollectableStorage(mechanism,15);goog.storage.collectableStorageTester.runBasicTests(mechanism,clock,storage)}function testLimitingNumberOfItems(){var mechanism=new goog.testing.storage.FakeMechanism,clock=new goog.testing.MockClock(!0),storage=new goog.labs.storage.BoundedCollectableStorage(mechanism,2);storage.set("item-1","one",1e4);clock.tick(100);assertEquals("one",storage.get("item-1"));storage.set("item-2","two",1e4);assertEquals("one",storage.get("item-1"));assertEquals("two",storage.get("item-2"));storage.set("item-3","three",5e3);clock.tick(100);assertUndefined(storage.get("item-1"));assertEquals("two",storage.get("item-2"));assertEquals("three",storage.get("item-3"));clock.tick(5e3);storage.set("item-4","four",1e4);assertUndefined(storage.get("item-1"));assertUndefined(storage.get("item-3"));assertEquals("two",storage.get("item-2"));assertEquals("four",storage.get("item-4"));storage.remove("item-2");storage.remove("item-4");clock.uninstall()}